<template>
  <v-layout row class="ma-10">
    <v-app-bar-nav-icon class="mb-3" @click.stop="drawing"></v-app-bar-nav-icon>

    <v-flex md12>
      <v-app style="background-color: white" class="ma-n4 ml-2">
        <v-container>
          <v-bottom-navigation color="#1D8348" grow class="mb-10">
            <v-btn to="/condidacies">
              <span>Candidatures</span>

              <v-icon>fa-clipboard-list</v-icon>
            </v-btn>

            <v-btn to="/condidacies-accepted">
              <span>Acceptées</span>

              <v-icon>fa-check-square</v-icon>
            </v-btn>

            <v-btn to="/condidacies-rejected">
              <span>Rejtées</span>

              <v-icon>mdi-delete</v-icon>
            </v-btn>
          </v-bottom-navigation>

          <v-btn
            @click="generatePDF"
            color="black"
            style="text-transform: none"
            class="white--text"
          >
            <v-icon>fa-download</v-icon>&nbsp;&nbsp;Télécharger la liste
          </v-btn>
         
          <v-btn
            @click="sendmail"
            color="black"
            style="text-transform: none"
            class="white--text"
          >
            <v-icon>f-email</v-icon>envoyer mail
          </v-btn>
          
          <v-alert
            class="mt-3 p-3"
            color="#C51162"
            dark
            icon="fa-laptop-code"
            dense
          >
            {{ getFullBranch }}
          </v-alert>
          <v-alert class="mt-3 p-3" color="#2A3B4D" dark icon="fa-tasks" dense>
            Candidatures acceptées
          </v-alert>
          <v-data-table
            v-model="selected"
            :headers="headers"
            :items="getListCondidaciesFilter"
            :items-per-page="5"
            :single-select="singleSelect"
            item-key="name"
            show-select
            class="elevation-1"
            @click:row="handleRowClick"
          >
            <template v-slot:top> </template>
          </v-data-table>
        </v-container>
      </v-app>
    </v-flex>

    <v-row justify="center" v-if="item != null">
      <v-dialog v-model="dialog" width="600px">
        <v-card>
          <v-card-title class="cyan darken-1">
            <span class="headline white--text">Dossier de candidature</span>
          </v-card-title>

          <v-list class="mt-7">
            <v-list-item>
              <v-list-item-action>
                <v-icon>account_circle</v-icon>
              </v-list-item-action>

              <v-list-item-content>
                <v-list-item-title class="mx-auto">
                  {{ item.firstname }} {{ item.lastname }} , {{ item.age }} ans
                  , {{ item.sexe }}
                </v-list-item-title>
              </v-list-item-content>
            </v-list-item>

            <v-divider inset></v-divider>

            <v-list-item>
              <v-list-item-action>
                <v-icon>mdi-email</v-icon>
              </v-list-item-action>

              <v-list-item-content>
                <v-list-item-title> {{ item.CNE }} </v-list-item-title>
              </v-list-item-content>
            </v-list-item>

            <v-divider inset></v-divider>

            <v-list-item>
              <v-list-item-action>
                <v-icon>school</v-icon>
              </v-list-item-action>

              <v-list-item-content>
                <v-list-item-title>
                  {{ item.diploma }}, {{ item.filliere }}
                </v-list-item-title>
              </v-list-item-content>
            </v-list-item>

            <v-divider inset></v-divider>

            <v-list-item>
              <v-list-item-action>
                <v-icon>mdi-phone</v-icon>
              </v-list-item-action>

              <v-list-item-content>
                <v-list-item-title> {{ item.phonenumber }} </v-list-item-title>
              </v-list-item-content>
            </v-list-item>

            <v-divider inset></v-divider>
          </v-list>

          <div class="pa-4">
            <v-chip-group color="primary" active-class="primary--text" column>
              <v-chip class="mr-2"> S1: {{ item.grade_s1 }} </v-chip>
              <v-chip class="mx-2"> S2: {{ item.grade_s2 }} </v-chip>
              <v-chip class="mx-2"> S3: {{ item.grade_s3 }} </v-chip>
              <v-chip class="mx-2"> S4: {{ item.grade_s4 }} </v-chip>
              <v-chip class="mx-2"> Diplome: {{ item.note }} </v-chip>
            </v-chip-group>
          </div>

          <v-card-actions>
            <v-spacer></v-spacer>
            <v-btn @click="dialog = false"> Fermer </v-btn>
            <v-btn @click="refuse(item.id)" color="error"> Refuser </v-btn>
          </v-card-actions>
        </v-card>
      </v-dialog>
    </v-row>
  </v-layout>
</template>

<script>
import { mapGetters } from "vuex";
import { mapActions } from "vuex";
import jsPDF from "jspdf";
import "jspdf-autotable";

export default {
  data() {
    return {
      item: null,
      dialog: false,
      singleSelect: false,
      selected: [],
      headers: [
        {
          text: "Prénom",
          value: "firstname",
        },
        {
          text: "Nom",
          value: "lastname",
        },
        { text: "Note diplome", value: "note" },
        { text: "Âge", value: "age" },
        { text: "Diplôme", value: "diploma" },
        { text: "Spécialité bac+2", value: "filliere" },
      ],
    };
  },

  beforeCreate() {
    this.$store.commit("changeDrawerToFalse");
  },

  methods: {
    ...mapActions(["upDateCondidacies", "refuseCondidacie"]),

    compare(a, b) {
      const lastnameA = a.lastname.toUpperCase();
      const lastnameB = b.lastname.toUpperCase();

      let comparison = 0;
      if (lastnameA > lastnameB) {
        comparison = 1;
      } else if (lastnameA < lastnameB) {
        comparison = -1;
      }
      return comparison;
    },

    async sendmail(){
     await axios.get("/api/sendmail",{ params: { branch: this.getBranch} })
     this.s('vous avez envoyé avec succès')
    },

    generatePDF() {
      const columns = [
        { title: "Nom", dataKey: "lastname" },
        { title: "Prénom", dataKey: "firstname" },
        { title: "Date de naissance", dataKey: "datebirth" },
        { title: "CIN", dataKey: "CNI" },
      ];

      const doc = new jsPDF({
        orientation: "portrait",
        unit: "cm",
        format: "letter",
      });

      var imgData =
        "data:image/png;base64,";

      doc.addImage(imgData, "JPEG", 1, 2, 20, 2);

      doc
        .setTextColor(231, 62, 1)
        .setFontSize(12)
        .text(this.getDepartement.toUpperCase(), 11, 5, "center");

      doc
        .setTextColor(102, 0, 153)
        .setFontSize(11)
        .text(`Filiere: ${this.getFullBranch}`, 11, 6, "center");

      var d = new Date();
      var acteulYear = d.getFullYear();
      var nextYear = Number(acteulYear) + 1;

      doc
        .setTextColor(102, 0, 153)
        .setFontSize(11)
        .text(
          `Année universitaire: ${acteulYear} - ${nextYear} `,
          11,
          7,
          "center"
        );

      doc
        .setTextColor(102, 0, 153)
        .setFontSize(11)
        .text(
          " Liste des candidats sélectionnés pour passer le concours",
          11,
          8,
          "center"
        );

      const list = this.getListCondidaciesFilter.sort(this.compare);

      doc.autoTable({
        columns,
        body: list,
        margin: { left: 2, top: 9 },
        didDrawPage: function (data) {

                    data.settings.margin.top = 2; 
        }
      });

      doc.save(`${this.getBranch}.pdf`);
    },

    handleRowClick(item) {
      this.dialog = !this.dialog;
      this.item = item;
    },
    refuse(idCondidacie) {
      this.refuseCondidacie(idCondidacie);
      this.dialog = !this.dialog;
    },
    drawing() {
      this.$store.commit("changeDrawer", this.drawer);
    },
  },

  computed: {
    ...mapGetters([
      "getListCondidacies",
      "getFullBranch",
      "drawer",
      "getBranch",
      "getDepartement",
    ]),

    getListCondidaciesFilter() {
      return this.getListCondidacies.filter(function (condidate) {
        return condidate.accepted === 1;
      });
    },
  },
};
</script>